import Tab from './Tab';

const OrePool = () => {
    return (
        <Div wp={100}  jc="c"  bg="fe"  >
            <Div w={1160}  >
              <Price />
              <Tab />
            </Div>
        </Div>
    )
}
export default OrePool;
